from selenium.webdriver.support.ui import WebDriverWait
import parse_page
import asyncio
import time

browser = parse_page.create_browser()
url = "https://www.laptopsdirect.co.uk/ct/laptops-and-netbooks/laptops/gaming"

try:
    browser.get(url)
    wait = WebDriverWait(browser, 5)

    parse_page.accept_cookies(wait)
    parse_page.load_full_page(wait, browser)
    links = parse_page.get_product_links(browser)

finally:
    browser.close()

